import React, { useContext } from "react";
import { Outlet } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { Button } from "antd";
import { UserContext } from "../../App";
import { Container, Wrapper, NavigateLink, IconImg } from "./styles";
import Icon from "../../media/cat-animal-icon.svg";

export default function Layout() {
  const navigate = useNavigate();
  const { user } = useContext(UserContext);

  const { token } = user || {};

  return (
    <Wrapper>
      <Container>
        <IconImg src={Icon}></IconImg>
        <NavigateLink href={"/"}>Home</NavigateLink>
        {!token && <NavigateLink href={"/login"}>Login</NavigateLink>}
        {!token && <NavigateLink href="register">Register</NavigateLink>}
      </Container>
      <Outlet />
    </Wrapper>
  );
}
